Barry Foster stars as Orde Wingate in this celebrated BBC production about the military career of one of the most controversial and unorthodox Allied commanders of World War II. Born into a religious family, the young Orde Wingate became a passionate Zionist during foreign service in Palestine. The revolutionary guerrilla tactics he developed there helped to prepare the future leaders of the Israeli Defense Force and secure his own place in history.


